Step-by-step reasoning:
1. Key psychological mechanisms: The responder’s utility reflects both the raw monetary gain (split_self) and a fairness‐evaluation process. The fairness judgment is based on the relative token contributions of the participant and the opponent. Offers below what one “deserves” (i.e. the fair share calculated as a fraction of the combined earning) incur a penalty. Here, rather than a linear or quadratic penalty, we use a logarithmic function to capture a concave sensitivity to fairness violations, which may reflect diminishing sensitivity as the fairness gap grows.
2. How these mechanisms interact: The offered share (split_self) contributes positively to utility. When this offer misses the fairness benchmark, the penalty grows as a logarithmic function of the discrepancy (with the penalty only active for offers below the computed fair share). An intercept parameter (mu) captures any overall bias, and a sensitivity parameter (lambda_param) scales the penalty.
3. Mathematical form: Define the fair share (r) as 
  r = combined_earning * (token_self/(token_self + token_opp))
Then define the fairness gap as 
  gap = max(r - split_self, 0)
The penalty for fairness loss is then proportional to ln(1 + gap). Utility is given by:
  U = mu + split_self - lambda_param * ln(1 + gap)
4. Needed parameters: Two learnable parameters are μ (mu) for baseline acceptance bias and λ (lambda_param) for sensitivity to deviations from the fairness benchmark.
5. Mapping to observable behavior: The computed utility U (which can be converted via a sigmoid or softmax later) predicts the likelihood that the responder views the offer as acceptable. Variables from the dataset (combined_earning, token_self, token_opp, and split_self) are used to compute the fairness benchmark and the penalty term.

